script: |
  super -f text -I q10566.spq | sort > q10566.out

inputs:
  - name: q10566.spq
    data: |
      SELECT + - 20 + - - 5 FROM tab2 (FORMAT parquet) WHERE - col2 * - col0 * - 64 NOT IN ( + col2, - col2 / - col2 );
  - name: tab2

outputs:
  - name: q10566.out
    data: |
      -15
      -15
      -15
